            "groundspeak:short_description": {
              "@html": "True", 
              "#text": "A Wherigo cartridge created specifically for MOGA 2009! A good old\nfashioned gunslinging, shoot em' up adventure. Yee Haw!<br />\n<br />\n<font color=\"red\"><b>PLEASE NOTE! This cartridge and cache will be\nmoved to a different location after MOGA 2009. If you plan to play\nthis cartridge after April 5, 2009, please make sure that you\ndownload version 1.3 of the cartridge.</b></font>"
            }, 
            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<b><font color=\"blue\">Cartridge</font></b><br />\nDownload the cartridge\n<a href=\"http://www.wherigo.com/cartridge/details.aspx?CGUID=abe23211-90da-46dc-a708-c4431ea5218c\">\nHERE</a><br />\n<br />\n<img src=\"http://img.geocaching.com/cache/ffcdc894-2bf1-469f-b41d-40cbec63acc3.jpg\" />\n <br />\n<br />\n<b><font size=\"3\" color=\"blue\">THE GAME</font></b><br />\n<br />\nThe bank has been robbed by a band of outlaws. They have stolen the\nsafe. It is your job as a gunslinger to take the bad guys out and\nrecover the safe for the bank.<br />\n<br />\nBe careful as there are innocent folk roaming the streets as well.\nIf you do not shoot all of the outlaws, they may take cover in one\nof their hideouts. If so, you will have to find their hideout and\ntake them down! Don't shoot at too many civilians or you may\nhang!<br />\n<br />\n<hr />\n<br />\n<b><font size=\"3\" color=\"blue\">Disclaimer</font></b><br />\n<br />\nI'm well aware that the locations and characters presented in this\ncartridge are NOT geographically or chronologically in sync.<br />\n<br />\n \n<hr />\n<br />\n<b><font size=\"3\" color=\"blue\">WHERIGO</font></b>\n<img src=\"http://img.geocaching.com/cache/aeacaddf-335d-4855-8407-0d097f9652cc.jpg\"\n     align=\"left\" />Wherigo is a toolset for creating and playing\n     GPS-enabled adventures in the real world. Use GPS technology\n     to guide you to physical locations and interact with virtual\n     objects and characters.\n     <a href=\"http://www.wherigo.com/about.aspx\"\n     target=\"_BLANK\">Learn more...</a> <br />\n<br />\n<br />\n<br />\n<hr />\n<br />\n<br />\n<b><font color=\"red\">A HUGE THANKS to Brawny Bear for the\nGunslinger artwork, LFrank, Denmother, &amp; Strider for the\npermission and encouragement to place this cache, and to Glenn for\nallowing this cache to be placed at the MOGA location and then\nmoved once the event ended.</font></b><p>Additional Waypoints</p>"
            }, 
            "groundspeak:encoded_hints": null, 
