                    "#text": "Out with jchaas & Panther07 this weekend.  They hadn't done a whereigo yet, so we thought we'd walk them through the process.\n\nThis was a great whereigo!  It was very nicely done.  I'm glad the campground wasn't too busy - we looked pretty funny wandering around in circles.\n\nWe completed the cartridge and didn't see a container near the GZ so we thought maybe there wasn't one since there isn't always a physical container with whereigos.  After reading past logs, looks like we need to go back and look for it.  We'll take care of that tomorrow.\n\nTFTC"
