            "groundspeak:country": "United States", 
            "groundspeak:state": "Illinois", 
            "groundspeak:short_description": {
              "@html": "True", 
              "#text": "<center><font face=\"comic sans ms\" color=\"#339900\" size=\"4\">The Dad of the Geocaching family \"Geotastic 4\" is completing his 3rd deployment as a member of the <a href=\"http://www.il.ngb.army.mil/\">Illlinois Army National Guard.</a><br />\nThis cache is dedicated to\u00a0\"Mr. Geotastic\", as I like to call him,\u00a0on his return home.\u00a0(hopefully for the last time)</font></center>"
            }, 
            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<center><font face=\"comic sans ms\" color=\"#339900\" size=\"4\">Not only is he the person that introduced me to geocaching, but he was my Battle Buddy during our deployment together in support of OIF 07-08.</font><a href=\"http://www.geocaching.com/profile/?guid=120349e5-4309-4be4-bf23-e64f1d75bf98&amp;wid=6d422c9f-6bb9-4885-a292-17b01749b382&amp;ds=2\"><img src=\"http://img.geocaching.com/cache/large/43ef76e9-d797-49b8-bc0f-78cd148682cf.jpg\" /></a><br />\n<br />\n<font size=\"3\">The battle buddy system is a procedure in which two Soldiers operate together as a team so that they are able to monitor and help each other. The main purpose of the system is improved safety and well-being. Each soldier may prevent the other from becoming a casualty, physically or mentally. These Soldiers often refer to each other as \"Battle\".<br />\n<br />\n<font face=\"comic sans ms\" color=\"#339900\" size=\"4\">This cache is an ammo can. It is full of Army themed swag and several other items young children might like. Feel free to take any of the toys for your own children or grandchildren.<br />\n<br />\n<font color=\"blue\">This cache is placed along the walking path in Williamsville Lake Park. <a href=\"http://www.williamsville.illinois.gov/index.php?option=com_content&amp;view=article&amp;id=51&amp;Itemid=62\">Williamsville Parks</a> are open from 5:00 am to 11:00 pm.<br />\n<br />\n<font color=\"red\"><strong>Do NOT remove the Stamp and Pad, they are part of the cache.</strong></font></font></font></font></center>\n\n<p>Additional Waypoints</p>"
            }, 
