            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<div style=\"border:3px solid #FF0000;border-radius:20px;padding:20px;margin-bottom:20px;\">\n<p style=\"text-align:center;\">A cemetery hide.</p>\n<p style=\"text-align:center;\">Do not cache after dark.</p>\n<p style=\"text-align:center;\">Do not cache while a service is going on.</p>\n</div>\n<div style=\"border:1px solid #A4A4A4;border-radius:20px;padding:20px;margin-bottom:20px;\">\n<p style=\"text-align:center;\"><u><strong>Biotite</strong></u></p>\n<p style=\"text-align:center;\"><strong><img alt src=\"https://s3.amazonaws.com/gs-geo-images/a50d2d24-4964-4ff8-86e2-8ac97f31ba95.jpg\" style=\"height:112px;width:250px;\" /></strong></p>\n<p>Biotite is a name used for a large group of black mica minerals that are commonly found in igneous and metamorphic rocks. Biotite is a common phyllosilicate mineral within the mica group; more generally, it refers to the dark mica series.</p>\n</div>\n<div style=\"border:1px solid #A4A4A4;border-radius:20px;padding:20px;margin-bottom:20px;\">\n<p style=\"text-align:center;\"><u><strong>Granite</strong></u></p>\n<p style=\"text-align:center;\"><strong><img alt src=\"https://s3.amazonaws.com/gs-geo-images/3e356b1c-33f3-4e13-8563-0d1422ae56ca.jpg\" style=\"height:167px;width:250px;\" /></strong></p>\n<p>First, granite is made of large mineral grains (which is where its name came from) that fit tightly together. Second, granite always consists of the minerals quartz and feldspar, with or without a wide variety of other minerals (accessory minerals). The quartz and feldspar generally give granite a light color, ranging from pinkish to white. That light background color is punctuated by the darker accessory minerals. Thus classic granite has a \"salt-and-pepper\" look. The most common accessory minerals are the black mica biotite and sometimes black amphibole hornblende.</p>\n</div>\n<p>\u00a0</p>\n<p style=\"text-align:center;\"><u><strong>Biotite, Feldspar, and Quartz as seen in granite</strong></u></p>\n<p style=\"text-align:center;\"><img alt src=\"https://s3.amazonaws.com/gs-geo-images/2da77e7a-75c7-4fff-85cd-296e500acbc9.jpg\" style=\"height:268px;width:250px;\" /></p>\n<div style=\"border:1px solid #A4A4A4;border-radius:20px;padding:20px;margin-bottom:20px;\">\n<p>You are going to be looking at the tomestone of \"Nicy M.\" her granite memorial stone has some big pieces of Biotite on the etched wording side. These are usually large and hardly seen this big within granite.</p>\n</div>\n<div style=\"border:3px solid #FF0000;border-radius:20px;padding:20px;margin-bottom:20px;\">\n<p style=\"text-align:center;\"><strong><u>**Logging requirements**<br />\nDO NOT POST ANSWERS IN YOUR LOG.<br />\nSend the following answers to me via email.</u></strong></p>\n<ol>\n<li>The text \"GC6HP67 Biotite\" on the first line</li>\n<li>Where are the three largest pieces of Biotite located on the grave stone?<br />\n<b>(i.e. behind \u201cN\u201d, below \u201cT\u201d and to the right of \u201cW\u201d)</b></li>\n<li>What size is the largest Biotite mineral?<br />\n<b>(A Centimeter ruler comes in handy here)</b></li>\n</ol>\n<marquee behavior=\"alternate\" bgcolor=\"#FFFFFF\">Congratulations to Team McOwen for FTF</marquee><br /></div>\n<div style=\"border:1px solid #A4A4A4;border-radius:20px;padding:20px;margin-bottom:20px;\">\n<table>\n<tr>\n<td align=\"center\"><a href=\"http://www.earthcache.org\"><img src=\"http://img.geocaching.com/user/3c7e38d2-f4d2-4ab5-91f6-0bf8039133f9.jpg\" border=\"0\" /></a><a href=\"https://lnt.org/\"><img src=\"https://d1u1p2xjjiahg3.cloudfront.net/f34818cc-2328-42ea-be23-325a1af40cdf.jpg\" hspace=\"20\" style=\"height:130px;width:130px;\" /></a><a href=\"https://www.facebook.com/groups/323122594389212/\"><img src=\"https://d1u1p2xjjiahg3.cloudfront.net/1feca8b4-5952-462b-bff0-394709923e6f.jpg\" border=\"0\" /></a></td>\n</tr>\n</table>\n</div>"
            }, 
