            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "The campus is the University of Tennessee at Martin. I graduated from this college in 1994. Check out the campus while you are there. To report the log, please enclose a photo taken from a computer of yourself with your GPSr. Make sure your computer can save the picture.<br />\nThe webcam link is: <a rel=\"nofollow\" href=\"http://www.utm.edu/about/webcams/epscam1.php\">UTM Webcam</a><br />\nPlease only use in daylight hours. UPDATE 2/6/16: New webcam camera location and link, one can use the right click and save to capture the photo.\n<p>Additional Waypoints</p>SDNKX4 - Stand here<br />N 36\u00b0 20.586 W 088\u00b0 52.023<br />Stand at this location, face away from the Elam Center towards the EPS building.<br />"
            }, 
